import React from 'react';

const NotFound = () => {
  return (
    <div className="text-center mt-20">
      <h1 className="text-4xl font-bold">404 - Page Not Found</h1>
      <p className="mt-4">Sorry, the page you're looking for doesn't exist.</p>
    </div>
  );
};

export default NotFound;
